// .Men_sheet_box {display: none;}
// .Kids_sheet_box {display: none;} 




/* BRAND BOX */
.Brand_sheet_box {
  background-color: #fff;
  display: flex;

  .Brand_outer {
    width: 20%;
    height: 500px;
    padding: 10px;
    box-sizing: border-box;

    a {
      display: block;

      img {
        width: 100%;
        height: auto;
        display: block;
      }

      p {
        width: 100%;
        height: 30px;
        line-height: 30px;
        text-align: center;
        font-weight: bold;
        padding-top: 15px;
      }
    }
  }
}

.hd_fix {
  position: fixed;
  top: 0;
  left: 0;
  background-color: $PointColor;
  z-index: 99999;
}




// 카테고리 메뉴 IMG 및 TXT
.TopArea {
  position: relative;
  z-index: 5;
  margin-top: 100px;

  .categoryBox{
    position: relative;
    width: 1420px;
    height: 350px;
    margin: 0 auto;
    background-image: url(./BACK_IMG/Fila_Category.jpg);
    background-repeat: no-repeat;
    background-size: cover;
    background-color: rgba(0, 0, 0, 0.4);
    background-blend-mode: hue;

    .categoryIMG {
      width: 100%;
      height: 100%;
    }

    ul{
      display: flex;
      flex-direction: row;
      flex-wrap: wrap;
      justify-content: space-evenly;
      align-items: center;
      
      width: 215px;
      height: 80px;
      position: absolute;
      left: 0;
      bottom: 0;
      color: #fff;

      li{
        font-size: 32px;
        font-weight: bold;
      }

      li:nth-child(2) {
        padding-top: 5px;
        font-size: 16px;
      }
    }

    img {
      width: 100%;
      height: auto;
      display: block;
    }
  }

  .filter {
    position: relative;
    width: 1420px;
    height: 50px;
    margin: 0 auto;
    background-color: #fff;

    border-bottom: 1px solid #eee;
    box-sizing: border-box;


    .filterBox {
      position: relative;
      display: flex;
      flex-direction: row;
      align-items: center;
      justify-content: space-between;
      height: 50px;

      .filterSide1 {
        display: flex;

        .filterSide_block1,
        .filterSide_block2 {

          width: 150px;

          span {
            padding: 0 20px;
            color: #000;
            font-weight: bold;
            cursor: pointer;
          }

          span:nth-child(2),
          span:nth-child(3) {
            width: 14px;
            padding: 0px;
            color: $PointColor;
          }

          span:nth-child(3) {
            display: none;
          }
        }
        .filterSide_block2 {
          display: none;
        }

        
      }
      .filterSide2 {
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        align-items: center;
        justify-content: space-between;
        width: 250px;
        height: 50px;

        select {
          outline: none;
          border: none;
          background-color: #fff;
          text-align: center;
          margin-right: 20px;
          cursor: pointer;
        }
        span {
          display: inline-block;
          padding: 0 20px;
          cursor: pointer;

          img {
            width: 100%;
            height: auto;
            display: block;
          }
        }
        span:nth-child(2) {
          position: relative;
          z-index: -5;
          width: 1px;
          height: 18px;
          border-right: 1px solid #aaa;padding: 0;
          cursor: auto;
        }
        span:nth-child(4) {
          padding-left: 0px;
        }
      }

      #filterReset {
        position: absolute;
        left: 130px; top: 12px;
        color: #aaa;
      
        span {
        display: inline-block;
        width: 80px;
        height: 25px;
        line-height: 22px;
        font-size: 12px;
        color: #777;
        box-sizing: border-box;
        cursor: pointer;
        background-color: #eee;
        border: 1px solid #eee;
        text-align: center;
        border-radius: 30px;
        transition: 0.3s;
        }

        span:hover {
          background-color: $PointColor;
          color: #fff;
        }
      }
    }

    .filter_menuDown {
      display: flex;
      width: 1420px;
      height: 0px;
      flex-direction: row;
      flex-wrap: wrap;
      justify-content: space-between;
      // border-bottom: 1px solid #eee;
      box-sizing: border-box;
      overflow: hidden;
      background-color: #fff;
      float: left;

      .Ft_Arr {
        width: 220px;
        height: 100%;

        h1 {
          width: 100px;
          margin: 0 auto;
          text-align: center;
          padding: 15px 0;
          font-size: $LageFont;
        }
        input {display: none;}
        label {
          display: block;
          width: 110px;
          height: 40px;
          line-height: 40px;
          margin: 0 auto;
          cursor: pointer;
        }
      }

      .Filter_Sports {
        box-sizing: border-box;

        div {
          padding-left: 20px;
          width: 150px;
          margin: 0 auto;
          box-sizing: border-box;

          input {
            display: inline-block;
            box-sizing: border-box;
          }
          label {
            display: inline-block;
            box-sizing: border-box;
          }

          label:hover {
            color: $PointColor;
            font-weight: bold;
            transition: 0.3s;
          }
        }
      }

      .Filter_Color {
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        align-content: flex-start;
        justify-content: space-evenly;

        h1 {
          width: 300px;
        }


        .Filter_red,
        .Filter_skyblue,
        .Filter_green,
        .Filter_yellow {
          display: flex;
          

          input {display: none;}
          label {
            display: inline-block;
            width: 38px;
            height: 38px;
            border-radius: 50%;
            cursor: pointer;
            margin: 0 auto;
            background-image: url(./BACK_IMG/RED.png);
            background-size: cover;
            background-repeat: no-repeat;
            margin-left: 5px;
          }
        }
        .Filter_skyblue label {
          background-image: url(./BACK_IMG/BLUE.png);
        }
        .Filter_green label {
          background-image: url(./BACK_IMG/GREEN.png);
        }
        .Filter_yellow label {
          background-image: url(./BACK_IMG/YELLOW.png);
        }
      }

      .Filter_Size {
        display: flex;
        flex-direction: row;
        flex-wrap: wrap;
        align-items: center;
        align-content: flex-start;
        padding: 0 10px;
        box-sizing: border-box;

        h1 {
          width: 300px;
        }

        input {display: none;}
        label {
          display: inline-block;
          width: 40px;
          height: 40px;
          margin: 5px;
          border: 1px solid #ccc;
          box-sizing: border-box;
          border-radius: 10px;
          text-align: center;
          cursor: pointer;
        }
        label:hover {
          border: 1px solid $PointColor;
          box-sizing: border-box;
        }
      }

      .Filter_Price {
        ul {
          display: flex;
          flex-direction: row;
          flex-wrap: wrap;
          align-items: center;
          justify-content: space-around;

          li {
            display: flex;
            align-items: center;
            
            input {
              width: 20px;
              display: inline-block;
            }
            label {
              width: 150px;
              display: inline-block;
              margin: 0;
            }
            label:hover {
              color: $PointColor;
              font-weight: bold;
              box-sizing: border-box;
            }
          }
        }
      }

      .Filter_Gender {
        ul {

          h1 {
            width: 200px;
          }

          li {
            display: flex;
            width: 300px;
            width: 55px;

            input{
              display: inline-block;
              width: 30px;
              margin-right: 5px;
            }
            
            label {
              width: 100px;
            }
            label:hover {
              color: $PointColor;
              font-weight: bold;
            }
          }
        }
      }

      .ft_bar {
        width: 1px;
        height: 340px;
        margin: 60px 0;
        border-right: 1px solid #eee;
        box-sizing: border-box;
      }
    }
  }
}




// ITEM ARRAY 

.item_Array_box1  {
  display: flex;
  flex-wrap: wrap;
  width: 1420px;
  margin: 0 auto;
  margin-top: 50px;
  flex-direction: row;

  .item_Arr {
    position: relative;
    width: 340px;
    height: 460px;
    margin-bottom: 20px;
    overflow: hidden;
    cursor: pointer;
    margin: 7px;

    img {
      display: inline;
      width: 100%;
      height: auto;
      display: block;
    }
    img:hover {
      scale: 1.1;
      transition: 0.3s;
    }
  }

  .item_bt {
    position: absolute;
    left: 0;
    bottom: 0;
    width: 100%;
    height: 120px;

    .btm_txt {
      width: 68%;
      height: 120px;
      padding: 5px;
      box-sizing: border-box;
      background-color: #fff;
      cursor: auto;
      float: left;

      p {
        margin-top: 5px;
        font-size: 14px;
      }
      h3 {
        padding-top: 5px;
        height: 60px;
        box-sizing: border-box;
      }
      h4 {
        color: $PointColor;
      }
    }
    .btm_btn {
      width: 32%;
      height: 120px;
      padding: 10px;
      float: right;
      box-sizing: border-box;
      background-color: #fff;
      cursor: auto;

      div {
        margin-top: 10px;
        width: 30px;
        height: 30px;
        margin-left: 2px;
        margin-right: 15px;
        float: left;
        cursor: pointer;

        img {
          width: 100%;
          height: auto;
          display: block;
          padding-top: 5px;
        }
      }
      div:nth-child(2) {
        padding-top: 2px;
        margin-right: 5px;
        float: right;
        box-sizing: border-box;
      }

      input {
        display: none;
      }
      label {
        display: inline-block;
        width: 90px;
        height: 40px;
        text-align: center;
        line-height: 35px;
        border: 2px solid #000;
        box-sizing: border-box;
        border-radius: 30px;
        margin-top: 20px;
        font-size: 14px;
        font-weight: bold;
        cursor: pointer;
      }
      label:hover {
        background-color: $PointColor;
        border: 2px solid $PointColor;
        color: #fff;
        transition: 0.3s;
      }
    }
  }
}


.noFilter {
  display: none;
  width: 1420px;
  height: 100px;
  margin: 0 auto;

  h1 {
    width: 800px;
    margin: 0 auto;
    line-height: 100px;
    color: #aaa;
    text-align: center;
    font-size: 50px;
  }
}








.pagination {
  display: flex;
  align-items: center;
  width: 1420px;
  height: 50px;
  margin: 70px auto;

  ul {
    display: flex;
    flex-direction: row;
    flex-wrap: wrap;
    justify-content: space-between;
    width: 200px;
    margin: 0 auto;
    
    li {
      a {
        color: #bbb;
      }
    }
  }
}











































  /* footer ============ */
  #footer {
    display: flex;
    justify-content: center;
    width: 100%;
    height: 40vh;
    font-size: 12px;
    overflow: hidden;
    background-color: #eee;
    color: #777;

    .footer_box {
      width: 1420px;
      display: flex;
      flex-direction: row;
      flex-wrap: wrap;
      height: 8vh;

      .foot_top {
        width: 100%;
        height: 8vh;

        .ft_log {
          width: 80px;
          padding: 7px 0;
          margin-top: 15px;
          box-sizing: border-box;
          float: left;

          img {
            width: 100%;
            height: auto;
            display: block;
          }
        }
        .ft_SNS {
          display: flex;
          justify-content: space-around;
          width: 200px;
          margin-top: 25px;
          font-size: 20px;
          float: right;
        }
        
      }
    }
    .foot_mid {
      width: 55%;
      background-color: #eee;

      .ft_menu {
        height: 21vh;
        font-weight: normal;

        ul {
          width: 24%;
          float: left;

          li {
            padding: 4px 0;
            text-align: center;
            font-size: 12px;

            a {
              color: #777;
              display: block;
            }
          }
          li:hover a {
            color: $PointColor;
            font-weight: bold;
            transition: 0.3s;
          }
          li:first-child {
            padding-bottom: 7px;
            font-size: 14px;
            font-weight: bold;
            
            a {
              color: #444;
            }
          }
        }
        ul:nth-child(1) {
          margin-left: 2%;
        }
        ul:nth-child(4) {
          width: 24%;
          margin-right: 2%;
